import React from "react";
import styled from "styled-components";
const Title = styled.h2`
  margin-left: 227px;
  margin-top: 60px;
  font-family: Lato;
  font-size: 30px;
  font-weight: 800;
  line-height: 30px;
`;

const Card = styled.div`
  width: 237px;
  height: 298px;
`;

const Movies = () => {
  return (
    <div>
      <Title>Movies</Title>
    </div>
  );
};

export default Movies;
